import { createRoot } from 'react-dom/client'
import './styles.css'
import { App } from './App'
import { useState, useEffect } from 'react'

/*
Model JSX auto-generated by: https://github.com/pmndrs/gltfjsx
Command: npx gltfjsx@6.2.3 model.glb --transform --simplify --resolution=2048
Author: Omar Faruq Tawsif (https://sketchfab.com/omarfaruqtawsif32)
License: CC-BY-4.0 (http://creativecommons.org/licenses/by/4.0/)
*/

function Root() {
  const [windowWidth, setWindowWidth] = useState(window.innerWidth)

  useEffect(() => {
    const handleResize = () => setWindowWidth(window.innerWidth)
    window.addEventListener('resize', handleResize)
    return () => window.removeEventListener('resize', handleResize)
  }, [])

  const mobileStyles = {
    container: {
      position: 'absolute',
      top: 0,
      left: 0,
      width: '100vw',
      height: '100vh',
      pointerEvents: 'none',
    },
    pumpFun: {
      position: 'absolute',
      bottom: 60,
      left: 10,
      fontSize: '0.8rem',
      color: 'white',
      textAlign: 'left',
    },
    telegram: {
      position: 'absolute',
      bottom: 60,
      right: 10,
      fontSize: '0.8rem',
      color: 'white',
      textAlign: 'right',
    },
    title: {
      width: '100%',
      position: 'absolute',
      top: 10,
      fontSize: '2rem',
      color: 'white',
      textAlign: 'center',
      margin: '0 auto',
    }
  }

  const tabletStyles = {
    container: {
      position: 'absolute',
      top: 0,
      left: 0,
      width: '100vw',
      height: '100vh',
      pointerEvents: 'none',
    },
    pumpFun: {
      position: 'absolute',
      bottom: 80,
      left: 20,
      fontSize: '1.2rem',
      color: 'white',
      textAlign: 'left',
    },
    telegram: {
      position: 'absolute',
      bottom: 80,
      right: 20,
      fontSize: '1.2rem',
      color: 'white',
      textAlign: 'right',
    },
    title: {
      width: '100%',
      position: 'absolute',
      top: 20,
      fontSize: '3rem',
      color: 'white',
      textAlign: 'center',
      margin: '0 auto',
    }
  }

  const desktopStyles = {
    container: {
      position: 'absolute',
      top: 0,
      left: 0,
      width: '100vw',
      height: '100vh',
      pointerEvents: 'none',
    },
    pumpFun: {
      position: 'absolute',
      bottom: 100,
      left: 20,
      fontSize: '2rem',
      color: 'white',
      textAlign: 'left',
    },
    telegram: {
      position: 'absolute',
      bottom: 100,
      right: 20,
      fontSize: '2.1rem',
      color: 'white',
      textAlign: 'right',
    },
    title: {
      width: '100%',
      position: 'absolute',
      top: 20,
      fontSize: '4rem',
      color: 'white',
      textAlign: 'center',
      margin: '0 auto',
    }
  }

  let styles

  if (windowWidth < 768) {
    styles = mobileStyles
  } else if (windowWidth < 1024) {
    styles = tabletStyles
  } else {
    styles = desktopStyles
  }

  return (
    <>
      <App />
      <div className='press-start-2p-regular' style={styles.container}>
        <a className='press-start-2p-regular pumpFun' href="https://pump.fun/6y3uoLaD377QWHCFxN9fcYuYthXawEDyB3gsUGtkpump" style={styles.pumpFun}>
          PUMP.FUN
          <br />
          Crypto: From Beginning To The End
        </a>
        <div style={styles.telegram}>
          <a className='press-start-2p-regular' href='#' style={{ color: 'white' }}>Telegram</a>
        </div>
        <a className='tit press-start-2p-regular' style={styles.title} href="#">
          Crypto: From Beginning <br /> To The End
        </a>
      </div>
    </>
  )
}

createRoot(document.getElementById('root')).render(<Root />)
